import './App.css';
import Login from './Login.js';
import About from './About.js';
import HomePage from './HomePage.js';
import SignIn from './SignIn.js';
import RecipyDetails from './RecipyDetails.js';
import SignUp from './SignUp.js';
import Recipies from './Recipies.js';
import Error from './Error.js';
import { useSelector } from "react-redux";
import { Route, Routes } from "react-router-dom";
import ShopingList from './‎ShopingList.js'

function App() {
  const userId=useSelector(state=>(state.userId));
  return (
  <HomePage/>,
      <Routes>
        <Route path="/" element={<HomePage />} />
        <Route path="/About" element={<About />} />
        <Route path="/HomePage" element={<HomePage />} />
        <Route path="/Login" element={<Login />} >
          <Route path="SignIn" element={<SignIn />} />
        </Route>
        <Route path="/RecipyDetails" element={<RecipyDetails />} />
        <Route path="/SignUp" element={<SignUp />} />
        <Route path="/Recipies" element={<Recipies />}/>
        <Route path="/ShopingList" element={<ShopingList userId={userId}/>} />
        <Route path="/*" element={<Error/>} />
      </Routes> 
  );
}

export default App;
